(57,	'text',	'Become an Eco-warrior',	10),
(58,	'text',	'Recycle your worthless stuff and be rewarded with a random prize. Check out the prizes and the instructions for recycling.',	10),
(59,	'text',	'Drag 5 items to the boxes below and click recycle!',	10),
